import { useSelector } from "react-redux";

const UserDisplayComponent = () => {
  //fetching data from Redux
  const usersFromRedux = useSelector((state) => {
    console.log(state.allUserReducer.allUsers);
  });

  console.log("data from REdux : ", usersFromRedux);
  return <div></div>;
};

export default UserDisplayComponent;
